const moviesData = Object.keys(movieCollection);

export default function App() {
  const [showMovie, setShowMovie] = useState("Thriller");

  function clickHandler(genre) {
    setShowMovie(genre);
  }
  return (
    <div className="App">
      <h1>Movie Recommendation</h1>

      <div className="buttons">
        {moviesData.map((genre) => (
          <button onClick={() => clickHandler(genre)}> {genre} </button>
        ))}
      </div>
      <ul>
        {movieCollection[showMovie].map((movie) => (
          <div className="movies">
            <li>
              <img className="image" src={movie.image} alt={movie.name} />
              <div>
                <h3>{movie.name}</h3>
                <span>Year: {movie.year}</span>
                <div style={{ marginTop: 20 }}>
                  <span>Description: {movie.desc}</span>
                </div>
                <div style={{ marginTop: 20 }}>
                  <span>Rating: {movie.rating}</span>
                </div>
              </div>
            </li>
          </div>
        ))}
      </ul>
    </div>
  );
}
